import org.apache.spark.ml.tuning.{ParamGridBuilder, TrainValidationSplit,TrainValidationSplitModel}
import scala.util.Random
//ParamGridBuilder构建一组参数
//TrainValidationSplit将尝试从这些所有值的组合中使用evaluator选出最好的模型
val paramGrid = new ParamGridBuilder()
//   .addGrid(rf.maxBins, Array(32, 60))
  .addGrid(rf.maxDepth, Array(10, 20, 30))
  .addGrid(rf.impurity, Array("entropy", "gini"))
  .addGrid(rf.minInfoGain, Seq(0.0, 0.05,1.0))
  .addGrid(rf.numTrees, Seq(5,10,30))
  .addGrid(rf.minInstancesPerNode, Array(10, 20))
  .addGrid(rf.featureSubsetStrategy, Array("auto", "sqrt","log2"))
  .addGrid(rf.subsamplingRate, Array(0.8, 1))
//   .addGrid(rf.maxMemoryInMB, Array(256, 512))
//   .addGrid(rf.checkpointInterval, Array(10, 20))
//   .addGrid(rf.cacheNodeIds, Array(false, true))
//   .addGrid(rf.seed, Array(123456L, Random.nextLong()))
.build()
val evaluator=new BinaryClassificationEvaluator().setLabelCol("label")
//TrainValidationSplit 需要一个Estimator ， 一个Estimator ParamMaps集，一个Evaluator
val trainValidationSplit = new TrainValidationSplit()
  .setEstimator(pipeline)
  .setEvaluator(evaluator)
  .setEstimatorParamMaps(paramGrid)
  // 80% of the data will be used for training and the remaining 20% for validation.
  //80%数据作为训练，剩下的20%作为验证
  .setTrainRatio(0.7)

// Run train validation split, and choose the best set of parameters.
//运行训练校验分离，选择最好的参数。
val model = trainValidationSplit.fit(trainingData)

// Make predictions on test data. model is the model with combination of parameters
// that performed best.
//在测试数据上做预测，模型是参数组合中执行最好的一个
val predictions = model.transform(testData)
predictions.select("id","predictedLabel","prediction", "label", "indexedLabel","features").where("predictedLabel=1.0").show(5)
//评估
val accuracy = evaluator.evaluate(predictions)
println("Test Error = " + (1.0 - accuracy))

import org.apache.spark.ml.{PipelineModel, Pipeline}
val bestModel = model.bestModel
val forestModel = bestModel.asInstanceOf[PipelineModel].
  stages(5).asInstanceOf[RandomForestClassificationModel]
// 输出随机森林模型的全部参数值
println(forestModel.extractParamMap)
// println(forestModel.getNumTrees)
// println(forestModel.getMaxDepth)
// println(forestModel.getImpurity)
// println(forestModel.getMinInfoGain)
println("Learned classification forest model:\n" + forestModel.toDebugString)
import org.apache.spark.sql.Row
import org.apache.spark.mllib.evaluation.BinaryClassificationMetrics
// Get evaluation metrics.
val metrics = new BinaryClassificationMetrics(predictions.select("prediction", "indexedLabel").map{case Row(prediction: Double, indexedLabel: Double) =>(prediction,indexedLabel)})

// Precision by threshold
val precision = metrics.precisionByThreshold
precision.foreach { case (t, p) =>
  println(s"Threshold: $t, Precision: $p")
}

// Recall by threshold
val recall = metrics.recallByThreshold
recall.foreach { case (t, r) =>
  println(s"Threshold: $t, Recall: $r")
}

// Precision-Recall Curve
val PRC = metrics.pr

// F-measure
val f1Score = metrics.fMeasureByThreshold
f1Score.foreach { case (t, f) =>
  println(s"Threshold: $t, F-score: $f, Beta = 1")
}

val beta = 0.5
val fScore = metrics.fMeasureByThreshold(beta)
f1Score.foreach { case (t, f) =>
  println(s"Threshold: $t, F-score: $f, Beta = 0.5")
}

// AUPRC
val auPRC = metrics.areaUnderPR
println("Area under precision-recall curve = " + auPRC)

// Compute thresholds used in ROC and PR curves
val thresholds = precision.map(_._1)

// ROC Curve
val roc = metrics.roc

// AUROC 
val auROC = metrics.areaUnderROC
println("Area under ROC = " + auROC)

import org.apache.spark.ml.tuning.{ParamGridBuilder, TrainValidationSplit,TrainValidationSplitModel}
import java.io.{FileInputStream,FileOutputStream,IOException,FileNotFoundException,ObjectOutputStream,ObjectInputStream}
def saveTrainValidationSplitModel(model:TrainValidationSplitModel, path:String)
{
      val fileOut:FileOutputStream  = new FileOutputStream(path)
      val out:ObjectOutputStream  = new ObjectOutputStream(fileOut)
      out.writeObject(model)
      out.close()
      fileOut.close()
}
def loadTrainValidationSplitModel(path:String): TrainValidationSplitModel =
{
  val fileIn:FileInputStream = new FileInputStream(path)
  val in:ObjectInputStream  = new ObjectInputStream(fileIn)
  val tvModel = in.readObject().asInstanceOf[TrainValidationSplitModel]
  in.close()
  fileIn.close()
  tvModel
}
